def get_reservation_from_db(reserve_id: int):
    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("SELECT user_id, room_id FROM reservations WHERE id = ?", (reserve_id,))
    row = cursor.fetchone()
    conn.close()

    if row:
        return {"user_id": row[0], "room_id": row[1]}
    else:
        return None

