# 수업시간 DB -> 나중에 외부 크롤링으로 관리
lecture_blocks = [
    {"start": "10:30", "end": "12:00"},
    {"start": "14:00", "end": "15:30"},
]

def lecture_to_unavailable_slots(lectures):
    slots = []
    for lec in lectures:
        start = datetime.strptime(lec["start"], "%H:%M")
        end = datetime.strptime(lec["end"], "%H:%M")
        while start < end:
            slots.append(start.strftime("%H:%M"))
            start += timedelta(minutes=30)
    return slots

def generate_time_slots(start="09:00", end="21:00", interval_minutes=30):
    slots = []
    current = datetime.strptime(start, "%H:%M")
    end_time = datetime.strptime(end, "%H:%M")

    while current <= end_time:
        slots.append(current.strftime("%H:%M"))  # ← 항상 2자리로 출력됨
        current += timedelta(minutes=interval_minutes)

    return slots

def get_reserved_slots():
    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("""
        SELECT start_time, end_time FROM reservations
        WHERE status IN ('reserved', 'in_use')
    """)
    rows = cursor.fetchall()
    conn.close()

    slots = []
    for row in rows:
        start = datetime.strptime(row[0], "%Y-%m-%dT%H:%M:%S")
        end = datetime.strptime(row[1], "%Y-%m-%dT%H:%M:%S")
        while start < end:
            slots.append(start.strftime("%H:%M"))
            start += timedelta(minutes=30)
    return slots

def get_all_unavailable_slots():
    lecture_slots = lecture_to_unavailable_slots(lecture_blocks)
    reserved_slots = get_reserved_slots()
    return set(lecture_slots + reserved_slots)

"""- 입실시간"""

@app.get("/available/start-times")
def get_available_start_times():
    all_slots = generate_time_slots()

    # 예외 처리: 수업 중인 시간대 또는 예약된 시간대는 여기에 추가
    unavailable_slots = []  # 예: ["11:00", "14:30"] ← 나중에 채움

    available = [t for t in all_slots if t not in unavailable_slots]
    return {"start_times": available}

"""- 퇴실시간"""

from fastapi import HTTPException

@app.get("/available/end-times")
def get_available_end_times(start_time: str):
    all_slots = generate_time_slots()
    unavailable_slots = list(get_all_unavailable_slots())

    # 예외처리 1: 잘못된 시작 시간
    if start_time not in all_slots:
        raise HTTPException(status_code=400, detail="잘못된 시작 시간입니다.")

    start_index = all_slots.index(start_time)
    max_end_index = start_index + int((5 * 60 + 1) / 30)

    available_end = []
    for i, t in enumerate(all_slots):
        if i > start_index and i <= max_end_index and t not in unavailable_slots:
            available_end.append(t)

    # 예외처리 2: 유효한 퇴실 시간이 아예 없는 경우
    if not available_end:
        raise HTTPException(status_code=400, detail="선택된 시작 시간 이후 유효한 퇴실 시간이 없습니다.")

    return {"end_times": available_end}

