"""## 입실시간 & 퇴실시간 (나중에 자바로)
- 입실 : 사용중 넘어가는 시간
- 퇴실 : 퇴실 희망 시간
![image.png](data:image/png;base64,)

## 사용시간 API : my-usage-time
"""

def get_active_reservation(user_id: str):
    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("""
        SELECT start_time, end_time
        FROM reservations
        WHERE user_id = ? AND status = 'in_use'
    """, (user_id,))
    row = cursor.fetchone()
    conn.close()
    return row

@app.get("/my-usage-time")
def get_usage_time(authorization: str = Header(...)):
    token = authorization.split(" ")[1]
    user_id = decode_token(token)

    row = get_active_reservation(user_id)
    if not row:
        raise HTTPException(status_code=404, detail="사용 중인 예약이 없습니다.")

    start_time_str, end_time_str = row
    start_time = datetime.fromisoformat(start_time_str)
    end_time = datetime.fromisoformat(end_time_str)
    now = datetime.now()

    minutes_left = max(int((end_time - now).total_seconds() // 60), 0)

    return {
        "start_time": start_time.isoformat(),
        "end_time": end_time.isoformat(),
        "minutes_left": minutes_left
    }

"""## 남은 시간 API : /my-usage-time"""

@app.get("/my-usage-time")
def get_usage_time(authorization: str = Header(...)):
    try:
        token = authorization.split(" ")[1]
        user_id = decode_token(token)

        conn = sqlite3.connect("reservations.db")
        cursor = conn.cursor()
        cursor.execute("""
            SELECT start_time, end_time
            FROM reservations
            WHERE user_id = ?
            ORDER BY id DESC
            LIMIT 1
        """, (user_id,))
        row = cursor.fetchone()
        conn.close()

        if not row or not row[0] or not row[1]:
            raise HTTPException(
                status_code=500,
                detail=f"예약 정보가 유효하지 않음. row: {row}"
            )


        start_time = datetime.fromisoformat(row[0])
        end_time = datetime.fromisoformat(row[1])
        now = datetime.now()

        minutes_left = max(int((end_time - now).total_seconds() // 60), 0)

        return {
            "start_time": start_time.isoformat(),
            "end_time": end_time.isoformat(),
            "minutes_left": minutes_left
        }

    except Exception as e:
        raise HTTPException(status_code=500, detail=f"서버 오류: {str(e)}")

