###OCR 인증을 통해 사용중으로 상태를 변경하는 기능

@app.post("/reserve/{id}/use")
async def use_reservation(
    id: int,
    file: UploadFile = File(...),
    authorization: str = Header(...)
):
    token = authorization.split(" ")[1]
    user_id = decode_token(token)

    reservation = get_reservation_from_db(id)
    if not reservation or reservation["user_id"] != user_id:
        raise HTTPException(status_code=403, detail="예약 정보 없음 또는 권한 없음")

    image = Image.open(BytesIO(await file.read()))
    ocr_text = pytesseract.image_to_string(image)

    expected_room = str(reservation["room_id"])
    if expected_room not in ocr_text:
        raise HTTPException(status_code=400, detail="사진에서 강의실 번호 확인 실패")

    now = datetime.now()
    now_str = now.strftime("%H:%M")

    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("""
        UPDATE reservations
        SET status = 'in_use', start_time = ?
        WHERE id = ?
    """, (now.isoformat(), id))
    conn.commit()
    conn.close()

    return {
        "message": f"{expected_room}호실 사용 시작됨",
        "start_time": now_str,
        "end_time": reservation["end_time"],
        "room": expected_room
    }

