@app.post("/reserve/{id}/exit")
async def exit_reservation(
    id: int,
    file: UploadFile = File(...),
    authorization: str = Header(...)
):
    token = authorization.split(" ")[1]
    user_id = decode_token(token)

    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("SELECT user_id, room_id FROM reservations WHERE id = ?", (id,))
    row = cursor.fetchone()
    conn.close()

    if not row or row[0] != user_id:
        raise HTTPException(status_code=403, detail="예약 정보 없음 또는 권한 없음")

    expected_room = str(row[1])

    image = Image.open(BytesIO(await file.read()))
    ocr_text = pytesseract.image_to_string(image)

    if expected_room not in ocr_text:
        raise HTTPException(status_code=400, detail="사진에서 강의실 번호를 확인할 수 없음")

    conn = sqlite3.connect("reservations.db")
    cursor = conn.cursor()
    cursor.execute("UPDATE reservations SET status = 'exited' WHERE id = ?", (id,))
    conn.commit()
    conn.close()

    return {
        "message": "퇴실 인증 완료",
        "room_number": expected_room
    }

